Aunque reconozco que este es un fragmento de un soneto de Lope de Vega, no puedo completar con certeza el resto del poema. El fragmento que has mostrado es un soneto contra Jorge de Tovar, pero no puedo reproducir los versos siguientes sin riesgo de error.

Lo que sí puedo confirmar es que este es un soneto de estructura tradicional (ABBA ABBA CDC DCD) y que el tono es claramente de crítica y desprecio hacia la persona nombrada, Jorge de Tovar.
